import { useEffect,useState } from "react";
import axios from "axios";

export default function PersonFList(){
    const [usuarios,setUser] = useState([])
    const [usuarios2,setUser2] = useState([])
    const url = 'https://jsonplaceholder.typicode.com/users'
    const urt2 = 'https://jsonplaceholder.typicode.com/users/1'

    useEffect(()=>{
        axios.get(url).then(req=>{
            const dadosusuarios=req.data
            setUser(dadosusuarios)
        })
    })
    useEffect(()=>{
        axios.get(urt2).then(req2=>{
            const detalhesusuario=req2.data
            setUser2(detalhesusuario)
        })
    })
    const detalhes=()=>{
        return(
            <div>
                {usuarios2.map((item,index)=>
                    <ul>
                        <li key={index}>Nome:{item.name}</li>
                        <li key={index}>Email:{item.email}</li>
                        <li key={index}>Telefone:{item.phone}</li>
                        <li key={index}>Site:{item.website}</li>
                    </ul>)}
            </div>
        )
    }
    return(
        <>
        <div className="detalhes">
            <div>
                {url2.map((item)=>
                    <div>
                        <span>Nome:{item.id=1}</span>
                        <br/>
                        <span>Email:{item.email}</span>
                        <br/>
                        <span>Telefone:{item.phone}</span>
                        <br/>
                        <span>Site:{item.website}</span>
                    </div>)}
            </div>
        </div>
         <table>
            <tbody>
            <tr id="titulo">
                <td>Nome</td>
                <td>Email</td>
                <td>Acao</td>
            </tr>
            {usuarios.map(item=>
                <tr>
                    <td>{item.name}</td>
                    <td>{item.email}</td>
                    <td><button onClick={detalhes} id="detalhes">Detalhes</button> <button id="excluir">Excluir</button></td>
                </tr>
                )}
            </tbody>
        </table>
        </>
    )
}
